import React from 'react';
import './add-component.css'
const AddComponent = () => {
    return (
        <button type='button'
                    className='btn btn-outline-danger btn-sm float-center'>
                        <i class="fas fa-plus"></i>
                        Add new element  
                    <i className="fa fa-trash-o" />
                </button>
        )
}
export default AddComponent;
